INSERT INTO `berita` VALUES (49,'2022-02-24','JARINGAN DOKUMENTASI DAN INFORMASI HUKUM SEBAGAI WUJUD PELAYANAN PUBLIK DI ERA DIGITAL','<p><span style=\"color: rgb(150, 150, 150); font-family: Montserrat, sans-serif; text-align: justify;\">Samarinda, (24/02) bertempat di Ballroom Hotel Grand Victoria Samarinda dilaksanakan kegiatan Pengelolaan dan Pengembangan JDIH dengan tema “Pemanfaatan dan Peningkatan Jaringan Dokumentasi dan Informasi Hukum (JDIH) Di Daerah Sebagai Wujud Pelayanan Publik Era Revolusi Digital 4.0”. Kegiatan ini dihadiri oleh Kepala Kantor Wilayah Kemenkumham Kalimantan Timur Sofyan, Kepala Divisi Pelayanan Hukum dan HAM Kantor Wilayah Kemenkumham Kalimantan Timur Sri Lastami beserta jajaran serta Pengelola JDIH di Wilayah Kalimantan Timur dan Kalimantan Utara. Hadir dari Pusat JDIHN Badan Pembinaan Hukum Nasional yakni Kepala Pusat Jaringan Dokumentasi dan Informasi Hukum Nasional Yasmon. Kegiatan dibuka oleh Sri Lastami yang menyampaikan laporan ketua panitia terkait kegiatan Pengelolaan dan Pengembangan JDIH di Provinsi Kalimantan Timur. Dalam sambutannya, Sri Lastami juga menyampaikan perkembangan pelaksanaan dan juga kendala yang dihadapi anggota JDIH di Provinsi Kalimantan Timur dan Kalimantan Utara dalam menyajikan informasi berupa dokumen hukum yang terupdate. “JDIH di era revolusi digital saat ini merupakan salah satu sumber informasi hukum yang sangat penting dikarenakan dengan memiliki informasi hukum yang tepat dan terupdate dapat memberikan manfaat bagi para pengambil kebijakan”, ujar Sri Lastami. Selanjutnya adalah pengarahan yang disampaikan oleh Kepala Kantor Wilayah Kemenkumham Kalimantan Timur dan penyerahan Sertifikat Integrasi yang ditanda-tangani oleh Menteri Hukum dan HAM secara simbolis kepada pengelola JDIH di Kalimantan Timur dan Utara yang telah terintegrasi Portal JDIHN.GO.ID. Dalam arahannya, Sofyan juga menyampaikan bahwa untuk mengelola dokumentasi dan informasi hukum yang lengkap, akurat, mudah dan cepat yang tersebar di berbagai instansi pemerintah dan institusi lainnya, perlu membangun kerjasama dalam suatu jaringan dokumentasi dan informasi hukum nasional yang terpadu dan terintegrasi. \"Dokumentasi dan informasi hukum yang tertata dengan baik dalam suatu jaringan Nasional merupakan bagian yang tidak terpisahkan dalam penyelenggaraan ketata pemerintahan yang baik, bersih dan bertanggung jawab untuk memenuhi tuntutan masyarakat atas dokumen dan informasi hukum yang dibutuhkan\", terang Sofyan. Dalam kesempatan yang sama Yasmon menyampaikan mengenai Penilaian Pengelolaan Jaringan Dokumentasi dan Informasi Hukum (JDIH) Tahun 2020 di wilayah Kalimantan Timur dan Kalimantan Utara. Untuk saat ini pengembangan dan pengelolaan JDIH lebih menekankan kepada peningkatan kinerja pengelola JDIH setelah terintegrasi dengan Pusat JDIHN. Ada beberapa hal yang menjadi fokus utama adalah update data dokumen hukum dan pelaporan JDIH sesuai dengan amanat Peraturan Presiden Nomor 33 Tahun 2012. “Pengelolaan JDIH di Provinsi Kalimantan Timur dan Provinsi Kalimantan Utara harus dapat mengikuti perkembangan dalam pengelolaan dokumen hukum terkini sehingga dapat meningkatkan jumlah dan kualitas database dokumen hukum nasional yang terintegrasi melalui website JDIHN.GO.ID”, terang Yasmon. Diakhir paparannya Yasmon juga menyampaikan bahwa JDIH akan menjadi penilaian reformasi birokrasi dan saat ini JDIH telah masuk dalam indikator penilaian SPBE yang dilaksanakan oleh Kementerian Pemberdayaan Aparatur Negara dan Reformasi Birokrasi.</span><br></p>','img-20220226-wa0019.jpg',1,'2022-03-01 08:51:03',1,'2022-03-01 08:51:03',1),(47,'2021-11-24','Kunjungan Tim JDIH Kota Kendari ke Kantor BPHN Kementerian Hukum dan HAM di DKI Jakarta','<p>Dalam rangka peningkatan pengelolaan JDIH Kota Kendari Bagian Hukum Sekretariat Daerah Kota Kendari dan Diskominfo Kota Kendari Pada Hari Rabu Tanggal 24 November 2021 melakukan kunjungan ke Kantor BPHN Kementerian Hukum dan HAM di DKI Jakarta untuk melakukan konsultasi peningkatan fitur pada aplikasi Versi 0.3 JDIH Kota Kendari.</p><p>Dimana kunjungan tersebut di terima oleh Kepala Bidang Otomasi Dokumentasi Hukum beserta Kepala Subbidang Pengelolahan Dokumentasi dan Informasi Hukum Ibu Sri Handayani, ST., M.B.A. .</p><p>Pada kunjungan tersebut Ibu Sri Handayani, ST., M.B.A. banyak menjelaskan koridor-koridor batasan yang wajib di lakukan pada pengelolaan dan Pengembangan Aplikasi JDIH Kota Kendari serta beliau memberikan apresiasi dan suport dimana pengelolaan Aplikasi JDIH Kota Kendari di bawah Bagian Hukum Sekretariat Kota Kendari telah menggandeng Diskominfo dalam pengelolaannya di bidang IT Suport JDIH Kota Kendari. - JDIH Kota Kendari</p>','whatsappimage2022-02-03at10.22.32.jpeg',1,'2022-02-03 09:38:00',1,'2022-02-03 09:38:00',1),(46,'2021-12-02','PERTEMUAN NASIONAL PENGELOLA JDIH SEBAGAI SARANA DAN KOMITMEN BERSAMA MEWUJUDKAN DIGITAL GOVERNMENT','<p><span style=\"color: rgb(150, 150, 150); font-family: Montserrat, sans-serif; text-align: justify;\">Jakarta (2/12) - Koordinasi dan kerja sama yang efektif antara Pusat Jaringan Dokumentasi Informasi Hukum Nasional (JDIHN) dan Anggota JDIHN dalam mengelola dokumentasi dan informasi hukum menjadi penting untuk mewujudkan sebuah sistem dan basis data nasional terintegrasi. Begitu juga kerja sama dan koordinasi antar sesama Anggota JDIHN baik di tingkat pusat maupun di daerah. Dengan demikian, JDIHN mampu terwujud dalam suatu ekosistem digital government yang memudahkan masyarakat memperoleh informasi atau data hukum secara cepat dan terpercaya. Dalam sambutannya Menteri Hukum dan HAM (Menkumham), Yasonna H. Laoly menjelaskan anggota JDIH yang terintegrasi dalam Portal JDIHN.GO.ID akan menjadi Khazanah Digital Dokumen Hukum Indonesia yang dapat dimanfaatkan oleh segenap pemangku kepentingan. JDIHN harus menjadi sarana yang efektif dalam mewujudkan masyarakat cerdas hukum di tanah air. “Kementerian Hukum dan HAM sebagai pembina atau Pusat JDIHN memiliki kewajiban untuk melaksanakan secara optimal tugas dan fungsi yang diembannya, melalui kerja sama dan sinergi dengan semua Anggota JDIHN,” kata Yasonna. Keberadaan JDIH pada sebuah institusi merupakan implementasi reformasi birokrasi sekaligus reformasi digital di bidang pelayanan hukum. Menkumham mengajak seluruh Anggota JDIHN untuk meningkatkan kualitas pengelolaan JDIH masing-masing karena kualitas JDIH Nasional tergantung pada kualitas JDIH seluruh anggota. Program Percepatan Integrasi Anggota JDIHN (PROPESI 2021) adalah terobosan dari Pusat JDIHN dalam mempercepat terbentuknya website JDIH dan pengintegrasian dengan Portal JDIHN. “Keberanian untuk terus melakukan inovasi harus terus dilakukan agar JDIHN terus tumbuh dan berkembang. Terlebih Kebijakan Pemerintah saat ini dalam mengoptimalkan pemanfaatan TIK dalam pelayanan pemerintah. JDIHN harus hadir menyongsong Digital Government,” tutur Yasonna. Menteri Hukum dan HAM memberikan apresiasi atas capaian, inovasi dan kinerja terbaik terus oleh dilakukan oleh Pusat JDIHN maupun Anggota JDIHN. Apresiasi itu diwujudkan dalam pemberian Anugerah JDIHN yang dilaksanakan dalam Pertemuan Nasional Pengelola JDIH hari ini, Selasa, Jakarta (2/12) di Hotel Grand Mercure Harmoni. Dalam kesempatan yang sama Kepala Badan Pembinaan Hukum Nasional (BPHN) Kementerian Hukum dan HAM RI Prof Widodo Ekatjahjana mengatakan bahwa secara keseluruhan, website JDIH yang telah terbentuk saat ini berjumlah 1.191. Dari jumlah tersebut, website JDIH yang sudah terintegrasi dengan Portal JDIHN.GO.ID berjumlah 1.169. “Ini merupakan langkah progresif BPHN dalam membantu Anggota-Anggota JDIHN yang belum memiliki website JDIH dengan membuatkan website, memberikan aplikasi standar pengelolaan JDIH (Aplikasi ILDIS), memberikan subdomain jdihn.go.id dan meng-hosting website JDIH pada data center Kementerian Hukum dan HAM,” ungkap Kepala BPHN. Lebih lanjut disampaikan oleh Kepala BPHN bahwa pengintegrasian website Anggota JDIHN dengan Portal JDIHN.GO.ID telah menghasilkan basis data dokumen hukum nasional. “Lebih dari lebih dari 350.000 dokumen hukum dalam bentuk produk regulasi dan non-regulasi yang dikelola dalam Portal JDIHN.GO.ID. Bahkan di beberapa Anggota JDIH ada inovasi, “JDIH Masuk Desa” dengan membentuk Pojok JDIH di sejumlah Kantor Kepala Desa. Tentu ini memberikan kemudahan bagi masyarakat untuk mendapatkan akses yang cepat dan mudah terhadap produk hukum yang diterbitkan pemerintah daerah maupun pemerintah pusat. Tidak hanya itu keberadaan aplikasi JDIH android yang diluncurkan secara resmi pada hari ini akan semakin memudahkan masyarakat mendapatkan dokumen hukum yang dibutuhkan,” tutur Kepala BPHN. Pertemuan Nasional ini juga menghadirkan narasumber dari Kementerian Perencanaan Pembangunan Nasional / Bappenas dan best practice dari pengelola JDIH terbaik.</span><br></p>','berita-rakornas-2021a-compress.jpg',1,'2022-02-03 09:34:50',1,'2022-02-03 09:34:50',1),(50,'2022-03-08','Wali Kota Serahkan Raperda Tentang Perusahaan Umum Daerah Pasar Kota Kendari kepada DPRD','<p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">Kendarikota.go.id – Wali Kota Kendari menyerahkan secara resmi Rancangan Peraturan Daerah (Raperda) Perusahaan Umum Daerah Pasar Kota Kendari tahun 2022, kepada Dewan Perwakilan Rakyat Daerah (DPRD) Kota Kendari dalam Rapat Paripurna DPRD, Senin (7/3/2022) malam.</p><p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">Wali Kota Kendari H. Sulkarnain Kadir mengatakan, penyerahan Raperda itu bertujuan, untuk menyelenggarakan otonomi daerah serta untuk mengali potensi keuangan daerah yang bertujuan untuk meningkatkan pendapatan masyarakat di Kota Kendari.</p><div class=\"jeg_ad jeg_ad_article jnews_content_inline_2_ads  \" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-align: center; color: rgb(51, 51, 51);\"><div class=\"ads-wrapper align-center \" style=\"margin: 1em 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"></div></div><p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">Wali kota mengaku perlu adanya perubahan untuk meningkatkan perekonomian daerah.</p><p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">“Kita menyerahkan rancangan peraturan daerah tentang perusahaan umum daerah pasar kota kendari, karena memang regulasinya yang menuntut itu, dan ini juga sudah kita konsultasikan ke pihak terkait termasuk pemerintah provinsi,” tutur Wali Kota Kendari.</p><p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">Lanjutnya, salah satunya dengan perubahan bentuk perusahaan umum daerah pasar Kota Kendari menjadi perusahaan umum daerah pasar Kota Kendari sebagai pengelola kegiatan usaha dan pengelola aset Pemerintah Kota Kendari.</p><p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">“Perusahaan umum daerah itu dalam pendiriannya bertujuan untuk memberikan manfaat umum untuk masyarakat,” tambah pasangan Siska Karina Imran ini.</p><p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">Hal itu, sesuai dengan kondisi daerah yang bertujuan memberikan manfaat bagi perkembangan perekonomian dan pembangunan daerah.</p><p style=\"text-align: justify; margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; vertical-align: baseline; text-rendering: optimizelegibility;\">Pengusulan Raperda pendirian Perumda pasar itu, diharapkan dapat berjalan dengan lancar hingga menjadi Peraturan Daerah (Perda) Kota Kendari.</p>','img-20220308-wa0008-750x375.jpg',1,'2022-03-09 07:39:55',1,'2022-03-09 07:39:55',1),(48,'2022-01-24','Rapat Paripurna, Penjelasan 3 Raperda oleh Wakil Walikota Kendari','<p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">DPRD Kota Kendari menggelar Rapat Paripurna dengan agenda penjelasan Walikota Kendari mengenai :</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">1. Raperda tentang Perubahan Keempat atas Perda Kota Kendari Nomor 2 Tahun 2011 tentang Pajak Daerah,</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">2. Raperda tentang Retribusi Penyediaan dan/atau Penyedotan Kakus,</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">3. Raperda tentang Pemberian Insentif dan/ atau Kemudahan Investasi.</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">Dalam rapat tersebut, Wakil Wali Kota Kendari, Siska Karina Imran memberikan penjelasan atas tiga Raperda, yakni Raperda tentang Perubahan Keempat Atas Perda Kota Kendari Nomor 2 Tahun 2011 tentang Pajak Daerah.</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">Pungutan daerah berupa pajak mineral bukan logam dan batuan diatur dalam Perda Kota Kendari Nomor 2 Tahun 2011 tentang Pajak Daerah, tarif pajak tersebut ditetapkan sebesar 25 persen harga patokan. Menurutnya, berdasarkan Peraturan Gubernur Sulawesi Tenggara (Sultra) Nomor 36 Tahun 2020 tentang Penetapan Harga Patokan Mineral bukan Logam dan Batuan, pengenaan pajak tersebut mengalami kenaikan yang cukup signifikan dan sangat memberatkan wajib pajak pada masyarakat sebagai konsumen akhir. Sehingga Pemerintah Kota Kendari, sesuai dengan kewenangannya, bermaksud melakukan perubahan tarif pajak mineral bukan logam dan batuan dengan melakukan perubahan atas Perda Nomor 2 Tahun 2011 tentang Pajak Daerah.</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">Selanjutnya, Raperda tentang Retribusi Penyediaan dan/atau Penyedotan Kakus. Ia mengatakan, dalam Perda Nomor 2 Tahun 2012 tentang Retribusi Jasa Umum, hanya mengatur tentang jenis dan tarifnya. Tidak terdapat klasifikasi objek layanan, sehingga dalam pelaksanaan pelayanan dan pemungutan retribusi tidak mencerminkan keadilan. Melalui Raperda yang baru lanjutnya, diharapkan dapat memaksimalkan fungsi Instalasi Pengolahan Lumpur Tinja (IPLT) dan mengoptimalkan Pendapatan Asli Daerah.</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(73, 75, 81); font-family: Roboto, sans-serif;\">Terakhir, Raperda tentang Pemberian Intensif dan/atau Kemudahan Investasi. Tentang itu, Siska mengatakan, dengan peraturan daerah tersebut, diharapkan mampu menciptakan iklim investasi yang kondusif dan menarik investasi baik penanaman modal asing maupun dalam negeri. Harapannya bisa mendorong perekonomian daerah dan menciptakan lapangan kerja di Kota Kendari.</p>','272660238_497288881740279_5850425135442819409_n.jpg',1,'2022-02-03 09:46:56',1,'2022-02-03 09:46:56',1),(51,'2022-03-21','Kemenkumham Sultra Beri Penghargaan Pada 6 Pemda dan 3 DPRD Se Sultra','<p style=\"margin-bottom: 1rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; text-align: justify;\">Kendari- Kantor Wilayah Kementerian Hukum dan HAM Sulawesi Tenggara (Kanwil Kemenkumham Sultra) beri penghargaan kepada enam pemerintah daerah (Pemda) dan tiga Dewan Perwakilan Rakyat Daerah (DPRD), Senin (21/3/2022). Penghargaan ini terkait kewajiban pelaksanaan harmonisasi Rancangan Peraturan Daerah dan juga kerjasama dalam proses Pembentukan Peraturan Daerah pada tahun 2021.</p><p style=\"margin-bottom: 1rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; text-align: justify;\">Adapun penerima penghargaan dari Kantor Wilayah Kementerian Hukum dan HAM Sulawesi Tenggara adalah sebagai berikut :</p><ol style=\"margin-bottom: 1rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><li style=\"text-align: justify;\">Pemerintah Provinsi Sulawesi Tenggara;</li><li style=\"text-align: justify;\">Pemerintah Daerah Kabupaten Bombana;</li><li style=\"text-align: justify;\">Pemerintah Daerah Kabupaten Buton</li><li style=\"text-align: justify;\">Pemerintah Daerah Kabupaten Muna Barat;</li><li style=\"text-align: justify;\">Pemerintah Daerah Kota Baubau;</li><li style=\"text-align: justify;\">Pemerintah Daerah Kota Kendari;</li><li style=\"text-align: justify;\">Dewan Perwakilan Rakyat Daerah Kabupaten Bombana;</li><li style=\"text-align: justify;\">Dewan Perwakilan Rakyat Daerah Kabupaten Konawe Kepulauan; dan</li><li style=\"text-align: justify;\">Dewan Perwakilan Rakyat Daerah Kota Kendari.</li></ol><p style=\"margin-bottom: 1rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; text-align: justify;\">Penghargaan tersebut diserahkan langsung oleh Kepala Kantor Wilayah Kementerian Hukum dan HAM Sulawesi Tenggara (Kakanwil Kemenkumham Sultra), Silvester Sili Laba, di aula Kantor Wilayah saat membuka kegiatan Rapat Koordinasi Pembentukan Peraturan Daerah Tahun 2022.&nbsp;&nbsp;</p><p style=\"margin-bottom: 1rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; text-align: justify;\">Dalam sambutannya, pria nomor satu Kemenkumham Sultra tersebut mengungkapkan bahwa hal ini sebagai bentu apresiasi Kantor Wilayah Kementerian Hukum dan HAM Sulawesi Tenggara terhadap Pemerintah Daerah dan juga DPRD atas kerjasama dalam mewujudkan Peraturan Daerah yang sesuai dengan Undang-undang. \"Penghargaan ini adalah bentuk apresiasi dan dukungan kami kepada Pemerintah Daerah dan DPRD. Bentuk dukungan yang lain, kami sudah merencanakan kegiatan pembinaan teknis bagi pejabat fungsional hasil penyetaraan jabatan yang instansi pembinanya Kementerian Hukum dan HAM. Habis lebaran, kita bisa mulai dengan pembinaan teknis perancang peraturan perundang-undangan, disusul penyuluh hukum dan analis hukum. Sehingga kita berharap, pejabat fungsional hasil penyetaraan tidak terhambat urusan pangkat dan karirnya sekaligus bisa memahami dengan baik tugas dan fungsinya.&nbsp;<span style=\"font-family: inherit;\">Dengan sinergi dan kerjasama ini, kami berharap ada manfaat lebih bagi kita semua serta menjadi daya dorong untuk senantiasa memberikan kontribusi terbaik bagi Daerah, Bangsa, dan Negara,\" ungkap Silvester.</span></p>','',NULL,'2022-03-22 12:59:31',1,'2023-11-20 05:20:06',1),(55,'2023-12-01','RAPAT KOORDINASI DAN EVALUASI PELAPORAN RENCANA AKSI HAM KOTA KENDARI','<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:7.5pt;margin-left:0cm\"><span style=\"font-size: 10.5pt; font-family: Helvetica, &quot;sans-serif&quot;;\">Kendari_\r\nKomitmen kuat pemerintah dalam menegakkan HAM telah dilaksanakan dalam Rencana\r\nAksi Nasional Hak asasi manusia (RANHAM) yang diamanatkan sesuai Perpres Nomor\r\n53 tahun 2021 bahwa pemajuan HAM di daerah di fokuskan pada Perlindungan\r\nHak-haK Disabilitas masyarakat rentan termarginalkan, masyarakat adat,\r\nmasyarakat miskin, penderita penyakit tertentu perempuan dan anak, pelayanan\r\ndan hak-hak tenaga kerja.<o:p></o:p></span></p><p>\r\n\r\n</p><p style=\"margin: 0cm 0cm 7.5pt;\"><span style=\"font-size: 10.5pt; font-family: Helvetica, &quot;sans-serif&quot;;\">RANHAM adalah dokumen yang memuat sasaran strategis yang digunakan\r\nsebagai acuan kementerian, lembaga, dan pemerintah daerah propinsi dan\r\nkabupaten/kota dalam rangka melaksanakan penghormatan, perlindungan, pemenuhan,\r\npenegakkan dan pemajuan HAM di Indonesia. Sebagai wujud komitmen Pemerintah Kota Kendari melalui Bagian Hukum telah menggelar Rapat Koordinasi Dan Evaluasi Pelaporan Rencana Aksi HAM pada\r\nhari Jumat, 1 Desember 2023 di ruang rapat Sekretaris Daerah&nbsp; yang\r\ndihadiri oleh stakeholder dan OPD terkait. Dalam kesempatan tersebut Kepala\r\nBagian Hukum Setda Kota Kendari Bapak Dr. Kurniawan Ilyas, S.H., M.H selaku\r\nketua Panitia dalam sambutannya berupaya untuk mensukseskan kegiatan RANHAM dari 7 aksi sasaran Program yang akan dicapai. Dan kegiatan ini&nbsp; dibuka langsung oleh Asisten III Setda\r\nKota Kendari Bapak Makmur, S.Pd.M.Pd bertempat di ruang rapat Sekda dan\r\nmenghadirkan narasumber yang berkompeten dari Kementerian Hukum Dan HAM\r\nPerwakilan Sultra ( Kabid. RANHAM Bapak Sunyoto, S.H., M.H) serta Kepala Biro Hukum Setda Prov. Sultra Bapak Syafril, S.H., M.Hum. yang menangani\r\nlangsung program tersebut. Dalam sambutannya, Asisten III Setda Kota Bapak\r\nMakmur, S.Pd., M.Pd Kendari menekankan agar program RANHAM dapat memberikan\r\ndampak positif bagi kelompok rentan yang menjadi sasaran pemerintah kota\r\nKendari.<o:p></o:p></span></p>','whatsappimage2023-12-01at11.04.02.jpeg',1,'2023-12-07 07:06:53',1,'2023-12-07 07:06:53',1),(56,'2023-12-29','Kota Kendari Meraih Kota Peduli HAM','<p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Pemerintah\r\nKota Kendari, Sulawesi Tenggara (Sultra) diganjar penghargaan sebagai kota\r\npeduli Hak Asasi Manusia (HAM) 2022 oleh Kantor Wilayah (Kanwil) Kementerian\r\nHukum dan HAM (Kemenkumham) Sultra.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Penghargaan\r\ntersebut diberikan Kepala Kantor Wilayah (Kakanwil) Kemenkumham Sultra,\r\nSilvester Sili Laba di ruang pola, kantor Gubernur Sultra pada Kamis\r\n(28/12/2023). Sekretaris Daerah (Sekda) Sultra, Asrun Lio yang menerimanya,\r\nselanjutnya memberikannya kepada Penjabat (Pj) Wali Kota Kendari, Muhammad\r\nYusup.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">sambutannya,\r\nSilvester Sili Laba mengatakan bahwa penghargaan tersebut diberikan kepada\r\nkabupaten kota yang dianggap memenuhi kriteria peduli HAM dengan mengacu pada\r\nUUD 1945, UU nomor 39 tahun 1999 tentang HAM, Perpres nomor 53 tahun 2021\r\ntentang rencana aksi nasional HAM sampai 2025.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Perpres\r\nnomor 60 tahun 2023 tentang strategi nasional bisnis dan HAM, peraturan\r\nMenkumham nomor 22 tahun 2021 tentang kriteria kabupaten kota peduli HAM,\r\nKeputusan Gubernur Sultra nomor 657 tahun 2023 tentang pembentukan gugus-gugus\r\ndaerah bisnis dan HAM Sultra dan lainnya.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal;background:\r\n#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Penetapan\r\nKota Kendari sebagai kota peduli HAM berdasarkan SK Menkumham nomor\r\nM-AH.03.HA.02.01.01 tahun 2023 tanggal 15 November tahun 2023.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">“Kriterianya\r\nadalah hak ekonomi dan sosial budaya sebagaimana diatur dalam UU nomor 11 tahun\r\n2025 dan lainnya,” ungkap Silvester.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Menyikapi\r\ncapaian tersebut, Pemkot Kendari dalam hal ini Bagian Hukum Setda Kendari\r\nberkomitmen untuk mempertahankannya sesuai dengan tagline Pj Wali Kota Kendari,\r\nMuhammad Yusup yaitu Kota Kendari harus aman, nyaman dan bahagia.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">“Sehingga,\r\nuntuk 2024 nantinya dengan kepemimpinan beliau saat ini, bagian hukum atau\r\npemerintah kota akan mempertahankan sebagai kota peduli HAM,” tutur Kabag Hukum\r\nSetda Kendari, Kurniawan Ilyas saat ditemui di ruangannya.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal;background:\r\n#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Untuk\r\nmempertahankan capaian dan menjalankan tagline Pj Wali Kota Kendari, Kurniawan\r\nmengatakan bahwa tata pemerintahan harus menjaga integritas. Selain itu, harus\r\nmenjaga situasi kondusif jelang Pemilu dan semua warga bisa menikmati\r\npembangunan-pembangunan di Kota Kendari.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Sehingga\r\nkebahagiaan tidak hanya dirasakan oleh lingkup pemerintahan melainkan\r\nmasyarakat Kota Kendari. Kata Kurniawan, kota peduli HAM itu berarti duduk sama\r\nrendah, berdiri sama tinggi, berdiri sama jalan.<o:p></o:p></span></p><p style=\"margin-bottom: 21px; font-family: Verdana, BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, Cantarell, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; background-color: rgb(234, 234, 234);\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:15.75pt;text-align:justify;line-height:\r\nnormal;background:#EAEAEA\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">“Bagian\r\nHukum tentu akan mengawal tagline beliau utamanya yang mengarah agar\r\nterwujudnya masyarakat Kota Kendari yang aman, nyaman dan bahagia,” tutur\r\nKurniawan.&nbsp;<o:p></o:p></span></p>','whatsappimage2023-12-28at14.45.03.jpeg',1,'2024-01-10 04:32:02',1,'2024-01-10 04:32:02',1);
