INSERT INTO `narasi` VALUES (1,'<p style=\"text-align: center;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-family: Verdana;\">﻿</span><span style=\"font-family: Verdana;\">﻿</span><span style=\"font-size: 16px; font-family: Verdana;\"><b style=\"text-decoration-line: underline;\">#NARASI</b></span></span></p><p style=\"text-align: center;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size: 16px; font-family: Verdana;\">SELAMAT BERGABUNG DI JARINGAN DOKUMENTASI DAN INFORMASI HUKUM KOTA KENDARI.</span><br></span></p><p style=\"text-align: center;\"><font face=\"Open Sans, sans-serif\"><span style=\"font-size: 16px; font-family: &quot;Courier New&quot;; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Verdana;\">KAMI SENANTIASA&nbsp; BERKOMITMEN MEMBERIKAN SAJIAN INFORMASI HUKUM DENGAN AKSES CEPAT, MUDAH DAN TERKINI KEPADA STAKEHOLDER MASYARAKAT KOTA KENDARI, PENGUSAHA, LSM/ORMAS/PERKUMPULAN, INSTANSI/LEMBAGA/BADAN PEMERINTAHAN LAINNYA, DAN SKPD DI LINGKUNGAN PEMERINTAH KOTA KENDARI.</span>&nbsp;</span></font></p><p style=\"text-align: center;\"><font face=\"Open Sans, sans-serif\"><span style=\"font-size: 16px; font-weight: bold; font-family: Verdana; background-color: rgb(255, 255, 255);\">#FIKSI HUKUM</span></font></p><p style=\"text-align: center;\"><span style=\"background-color: rgb(255, 255, 255);\"><span lang=\"IN\" style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-font-kerning:\r\n0pt;mso-ligatures:none;mso-ansi-language:IN;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\"><span style=\"font-family: Verdana;\">Asas </span><i><span style=\"font-family: Verdana;\">Exeptio Format Regulam / Exeptio Frimat Vim Legis In Casibus Non </span></i></span><i><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: Verdana;\">E</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: Verdana;\">xceptis</span></i><span lang=\"IN\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:Calibri;mso-font-kerning:0pt;mso-ligatures:none;\r\nmso-ansi-language:IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"></span><font face=\"Open Sans, sans-serif\"><span style=\"font-size: 16px; font-weight: bold;\"><br></span></font></span></p><p style=\"text-align: center;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size: 16px; font-family: Verdana; text-decoration-line: underline;\"><b style=\"\">#QUOTE</b></span><br></span></p><p style=\"text-align: center;\"><span style=\"background-color: rgb(255, 255, 255);\"><font face=\"Open Sans, sans-serif\"><span style=\"font-size: 16px; font-family: Verdana;\">HUKUM ITU MENSEJAHTERAHKAN DAN MEMBAHAGIAKAN&nbsp;</span></font><span style=\"font-family: Verdana; font-size: 16px;\">JIKA ANDA MENGHARGAI HUKUM, MAKA IA AKAN MENJAGAMU, JIKA ANDA MENYIMPANGI HUKUM, MAKAI IA AKAN MENINGGALKANMU</span></span></p><p style=\"text-align: center;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size: 16px; font-family: Verdana;\"><b style=\"\">#SALAM HORMAT</b></span><br></span></p><p style=\"text-align: center;\"><font face=\"Open Sans, sans-serif\"><span style=\"font-size: 16px; font-family: Verdana; background-color: rgb(255, 255, 255);\">JARINGAN DOKUMENTASI DAN INFORMASI HUKUM KOTA KENDARI</span></font></p>');
