INSERT INTO `pengumuman` VALUES (5,'2023-04-26','RELAAS PANGGILAN KEPADA TERGUGAT NOMOR : 46/Pdt.G/2023/PN.Kdi','PENGADILAN NEGERI KENDARI','<p>Relaas Pemberitahuan Nomor : 46/Pdt.G/2023/PN.Kdi diberitahukan kepada Pemerintah Republik Indonesia Cq. Pemerintah Kota Kendari, tempat kedudukan Jln. Abdulah Silondae Nomor 8 Kec. Mandonga Kota Kendari Keel. Mandonga Sulawesi Tenggara sebagai Tergugat I, dalam perkara perdata melawan La ode Kabias, SH, bertempat tinggal di Jln. Konawe Rt. 005/Rw. 003 Kel. Abeli Kota Kendari Sulawesi Tenggara. dalam hal ini memberikan kuasa kepada La ode Muh. Hiwayad, SH berdasrkan Surat Kuasa Khusustanggal 2 Januari 2022 selanjutnya disebuit sebagai Penggugat. dan H. Sulkarnain Kadir , SE,ME selanjutnya Tergugat II</p>','whatsappimage2023-12-08at11.44.35.jpeg',1,'relasp.46laodekabias.pdf','2023-12-08 03:40:34',1,1,'2023-12-08 03:45:37'),(6,'2023-12-21','SELEKSI ANUGERAH PARALEGAL JUSTICE AWARD 2024 BAGI LURAH/KEPALA DESA','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Seleksi anugerah Paralegal Justice Award Tahun 2024 bagi Kepala Desa/Lurah, Kepala Desa/Lurah sebagai tokoh yang dekat dengan masyarakat memiliki peran penting untuk mendamaikan dan menyelesaikan masalah-masalah hukum warganya. pemberian anugerah tersebut akan diawali dengan proses seleksi dan audisi, kemudian diikuti dengan penguatan kompetensi dalam penyelesaian masalah/konflik hukum melalui paralegal academy justice award.</p>','whatsappimage2023-12-21at09.07.05.jpeg',1,'3.seleksiparalegaljusticeaward2024bupatiwalikotagab.pdf','2023-12-21 01:14:13',1,1,'2023-12-21 01:14:13'),(7,'2024-03-05','RELAAS PANGGILAN SIDANG TERGUGAT PERKARA NO. 02/Pdt.G/20224/PN.KDI','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memanggil kepada Pemerintah Republik Indonesia Cq. Pemerintah Kota Kendari Alamat Jln. Abdullah Silondae No. 8 Kel. Mandonga Kec. Mandonga Kota Kendari Sultra disebut&nbsp; Tergugat II, untuk datang menghadap sidang pada Pengadilan Negeri Kendari yang akan diselenggarakan di Alamat : Jln. Mayjend Sutoyo No. 37 Tipulu Kota Kendari Hari/Tanggal : Selasa 20 Februari 2024 jam: 09.00 WITA Agenda : Pembacaan Gugatan dalam perkara antara La Ode Kabias, SH sebagai Penggugat lawan H. Sulkarnain Kadir, SE, ME sebagai para Tergugat</p>','',1,'relaspanggilansidangperkaraperdata.pdf','2024-03-05 03:41:23',1,1,'2024-03-05 06:26:53'),(8,'2024-03-04','RELAAS PANGGILAN NOMOR : 725/Pdt.G/2023/PA.Kdi','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memanggil Wa Reni Binti La ntaliku, tempat dan tanggal lahir Ambon, 01 Januari 1984, agama islam, IRT, tempat kediaman dahulu beralamat di Padaleu, Kambui, Kota Kendari, di Sulawesi Tenggara, sekarang tidak diketahui keberadaannya di wilayah NKRI</p>','',1,'relaaspanggilanpakendari.pdf','2024-03-05 06:37:10',1,1,'2024-03-05 06:37:10'),(9,'2024-03-04','RELAAS PEMERITAHUAN PUTUSAN KASASI NO. 32/Pdt.G/2022/PN.Kdi','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memberitahukan kepada Muh. Mansur Taufiq pekerjaan PNS dahulu beralamat di BTN. Wahana Kel. Mokoau Kec. Kambu Kota Kendari, sekarang tidak diketahui tetapi masih dalam wilayah dalam wilayah Negara Kesatuan Republik Indonesia, dahulu sebagai Tergugat I/Turut Terbanding sekarang sebagai Turut Termohon Kasasi.&nbsp;</p>','',1,'relaaspemberitahuankasasip.32.pdf','2024-03-05 06:59:49',1,1,'2024-03-05 06:59:49'),(10,'2024-03-05','RELAAS PEMBERITAHUAN PUTUSAN PENINJAUAN KEMBALI','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memberitahukan kepada <b>ATI</b>, dahulu bertempat tinggal di jalan H.Lamuse Kel. Lepo-lepo Kec. Baruga, sekarang tidak diketahui namun masih berada dalam satu wilayah Republik Indonesia, sebagai turut termohon<b> PK</b></p>','',1,'relaasno.74pdt.g.pdf','2024-03-05 07:08:29',1,1,'2024-03-05 07:08:29'),(11,'2024-03-05','RELAAS PANGGILAN KEPADA TERGUGAT NOMOR : 93/Pdt.G/2023/PN.Kdi','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memanggil SUNARTI GAFAR, dahulu beralamat di Jl. MT Haryono Kel. Wawowanggu Kec. Kadia Kota Kendari sekarang sudah tidak diketahui lagi namun masih berada di wilayah kesatuan Negara republik Indonesia, sebagai turut tergugat</p>','',1,'relaasno.93pdt.g2023.pdf','2024-03-05 07:16:48',1,1,'2024-03-05 07:16:48'),(12,'2024-03-05','RELAAS PANGGILAN KEPADA TERGUGAT NOMOR : 127/Pdt.G/2023/PN.Kdi','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memanggil Walikota/Kepala daerah Kota Kendari, tempat kedudukan Jl. Jend. Ahmad Yani, Mandonga Kota Kendari Sulawesi Tenggara sebagai tergugat</p>','',1,'relaasno127pdt.g2023.pnkdi.pdf','2024-03-05 07:36:47',1,1,'2024-03-05 07:36:47'),(13,'2024-03-14','RELAAS PEMBERITAHUAN PUTUSAN NOMOR : 888/Pdt.G/2023/PA.Kdi','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memberitahukan kepada Ricky Mh Bin P. Hutapea, tempat dan tanggal lahir, 21 November 2023, agama islam, pekerjaan tidak ada, tempat kediaman dahulu beralamat di Lahundape, Kec. Kendari Barat, Kota Kendari-SULTRA, sekarang tidak diketahui keberadaannya di wilayah NKRI, sebagai Tergugat; tentang isi putusan Pengadilan Agama Kendari Nomor 888/Pdt.G/2023/PA.Kdi tanggal 05 Maret 2024 dalam perkara cerai Gugat antara Ida Haritanti, SE Binti Hamusi sebagai Penggugat; Melawan Ricky Mh Bin P. Hutapea sebagai Tegugat</p>','',1,'relaaspemberitahuanputusanno.888.pdf','2024-03-14 02:39:05',1,1,'2024-03-14 02:39:05'),(14,'2024-03-14','RELAAS PANGGILAN SIDANG TERGUGAT NOMOR : 02/Pdt.G/2024/PN.Kdi','BAGIAN HUKUM SEKRETARIAT DAERAH PEMERINTAH KOTA KENDARI','<p>Telah memanggil kepada PEMERINTAH REPUBLIK INDONESIA Cq. PEMERINTAH KOTA KENDARI alamat Jln. Abdulah Silondae Nomor 08 Kel. Mandonga Kec. Mandonga Kota Kendari-SULTRA disebut sebagai Tergugat II; untuk datang menghadap sidang pada Pengadilan Negeri Kendari yang akan diselenggarakan di Alamat : Jln. Mayjend Sutoyo No. 37 Tipulu Kota Kendari Pada hari rabu, 24 Januari 2024 jam. 09.00 WITA dalam perka